import React, { Component } from "react";

const ListSearchedNews = ({ snews, mode }) => {
  // const index = snews.lenght;
  console.log(snews);
  if (snews == undefined) {
    return (
      <>
        <h1>im here</h1>;
      </>
    );
  } else {
    return (
      <div className='card mb-3' style={{ maxWidth: "540px" }} mode={mode}>
        <div className='row no-gutters'>
          <div className='col-md-4'>
            <img
              src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fin.pinterest.com%2Fpin%2F774478467146356395%2F&psig=AOvVaw06s1zKO-6Ta7LOsxfwsFkv&ust=1597517565684000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPiHpequm-sCFQAAAAAdAAAAABAD'
              alt='...'
            />
          </div>
          <div className='col-md-8'>
            <div className='card-body'>
              <h5 className='card-title'>Title: {snews.name}</h5>
              <p className='card-text'>Description: {snews.description}</p>
              <p className='card-text'>
                <small className='text-muted'>
                  Published on : {snews.datePublished}
                </small>
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
};

export default ListSearchedNews;
